textOriginal:
Bom, em primeiro lugar, qualquer Ciência chega a conclusão simples que o totalitarismo da economia de mercado e capitalismo é um fracasso e um grande sistema imbecil de crueldade e destruição, comprovando que a solução pro mundo vai do socialismo ao comunismo e termina numa economia baseada em recursos, ou seja, a eliminação absoluta do sistema monetário e das classes sociais, com sua exploração, opressão e degradação;
Em segundo lugar, Albert Einstein era defensor do socialismo, não a toa escreveu um artido entitulado "Por Que Socialismo?", escrito originalmente para a revista Montly Review e publicada em Maio de 1949. Fico surpreso que o Meteoro não tenha falado disso. Temos a defesa do socialismo feito por Stephen Hawking; Stephen Jay Gould; Richard Levins; Nikola Tesla; Mário Schenberg; Marie Sktodowska Curie; Julius Robert Oppenheimer; Jonas Salk; Carl Sagan e muitos outros renomados cientistas que eram progressistas ou socialistas declarados.
Em resumo, seu vídeo foi muito fraco Meteoro.
